import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import './SellAnItem.css';


const SellAnItem = (props) => {
  const navigate = useNavigate();
  const [title, setTitle] = useState("");
  const [price, setDescription] = useState("");
  const [fee, setPrice] = useState("");

  const handleTitleChange = (event) => {
    setTitle(event.target.value);
  };

  const handleDescriptionChange = (event) => {
    setDescription(event.target.value);
  };

  const handlePriceChange = (event) => {
    setPrice(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    // Handle form submission
  };

  return (
    <div className="form-container">
      <h1>Sell An Item</h1>
      <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="title">Item Address</label>
          <input
            type="text"
            id="title"
            name="title"
            value={title}
            style={{ width: "200px", height: "30px" }}
            onChange={handleTitleChange}
          />
        </div>
        <div>
          <label htmlFor="title">   Item Price           </label>
          <input
            type="text"
            id="title"
            name="title"
            value={title}
            style={{ width: "200px", height: "30px" }}
            onChange={handleTitleChange}
          />
        </div>
        <div>
          <label htmlFor="title">Item Address</label>
          <input
            type="text"
            id="title"
            name="title"
            value={title}
            style={{ width: "200px", height: "30px" }}
            onChange={handleTitleChange}
          />
        </div>
        <button className="submit" onClick={() => navigate("/blog")}>
           Submit
        </button>
      </form>
      <br />
      <button onClick={() => navigate(-1)}>Back to Home</button>
    </div>
  );
};

export default SellAnItem;
